import React from "react";

const Day28 = (props) => {
  return (
    <div className="day">
      <h2>May 28</h2>
      <h3>The Main Event!</h3>

      <div>
        <h4>Preparations</h4>
        <p>During most of the day we will be making final preparations. If you would like to join to help out you're more than welcome. However you're also encouraged to spend time exploring the area on your own.</p>
      </div>


    </div>
  );
};

export default Day28;
